/* -------------- productList -------------- */
import shoppingList from "./data.js";
//export로 내보낸 변수를 가져와 쓰는것

const productList = document.querySelector('.product_list')

for (let i = 0; i < shoppingList.length; i++) {
//for (let i = 0; i < 16; i++) {

  const productLi = document.createElement('li')
  //productLi.setAttribute('class', 'productLi')

  const productImgDiv = document.createElement('div')
  productImgDiv.setAttribute('class', 'product_img')
  productLi.appendChild(productImgDiv)

  const productImgA = document.createElement('a')
  productImgA.setAttribute('href', './detail.html')
  productImgDiv.appendChild(productImgA)

  const productImg = document.createElement('img')
  productImg.setAttribute('src', shoppingList[i].src)
  productImgA.appendChild(productImg)

  const productTxtDiv = document.createElement('div')
  productTxtDiv.setAttribute('class', 'product_txt kor')
  productLi.appendChild(productTxtDiv)

  const productName = document.createElement('p')
  const productNameTxt = document.createTextNode(shoppingList[i].name)
  productName.appendChild(productNameTxt)
  productTxtDiv.appendChild(productName)

  const productPrice = document.createElement('span')
  const productPriceText = document.createTextNode(shoppingList[i].price)
  productPrice.appendChild(productPriceText)
  productTxtDiv.appendChild(productPrice)

  productList.appendChild(productLi)
} //shoppingList_for


/* -------------- pagination -------------- */
$(document).on('click', '.paging .pages>span', function () {
  if (!$(this).hasClass('active')) {
    $(this).parent().find('span.active').removeClass('active');
    $(this).addClass('active');
  }
});

let thisPage = 1;
const limit = 16; // 페이지당 데이터 건수
const totalCount = 40
const pageCount = 3

function Pagination(currentPage) {
  if (totalCount <= 16) return;

  let totalPage = Math.ceil(totalCount / limit); //3
  let pageGroup = Math.ceil(thisPage / pageCount); //1

  let last = pageGroup * 3;
  if (last > totalPage) last = totalPage;
  let first = last - (3 - 1) <= 0 ? 1 : last - (3 - 1);
  let next = last + 1;
  let prev = first - 1;

  const prePage = document.createDocumentFragment();
  if (prev > 0) {
    let allpreli = document.createElement('li');
    allpreli.insertAdjacentHTML("beforeend", `<a href='#js-bottom' id='allprev'>&lt;&lt;</a>`);

    let preli = document.createElement('li');
    preli.insertAdjacentHTML("beforeend", `<a href='#js-bottom' id='prev'>&lt;</a>`);

    fragmentPage.appendChild(allpreli);
    fragmentPage.appendChild(preli);
  }

  for (let i = first; i <= last; i++) {
    const li = document.createElement("li");
    li.insertAdjacentHTML("beforeend", `<a href='#js-bottom' id='page-${i}' data-num='${i}'>${i}</a>`);
    fragmentPage.appendChild(li);
  }

  if (last < totalPage) {
    var allendli = document.createElement('li');
    allendli.insertAdjacentHTML("beforeend", `<a href='#js-bottom'  id='allnext'>&gt;&gt;</a>`);

    var endli = document.createElement('li');
    endli.insertAdjacentHTML("beforeend", `<a  href='#js-program-detail-bottom'  id='next'>&gt;</a>`);

    fragmentPage.appendChild(endli);
    fragmentPage.appendChild(allendli);
  }

  document.getElementById('paging').appendChild(fragmentPage);
  // 페이지 목록 생성

  $(`#paging a`).removeClass("active");
  $(`#paging a#page-${currentPage}`).addClass("active");

  $("#paging a").click(function (e) {
    e.preventDefault();
    var $item = $(this);
    var $id = $item.attr("id");
    var selectedPage = $item.text();

    if ($id == "next") selectedPage = next;
    if ($id == "prev") selectedPage = prev;
    if ($id == "allprev") selectedPage = 1;
    if ($id == "allnext") selectedPage = totalPage;

    list.Pagination(selectedPage); //페이지네이션 그리는 함수
    list.search(selectedPage); //페이지 그리는 함수
  });
};


/* -------------- top_btn -------------- */

$('.top_btn').click(function (e) {
  e.preventDefault()
  $('html, body').stop().animate({
    scrollTop: 0
  }, 500)
});//btn_top_click_event



/* -------------- shopping_history -------------- */
const historyPopup = $('.history_popup')
const historyBtn = $('.history_btn')
const hideBtn = $('.history_hide')
const shoppingHistory = $('.shopping_history')
const historyList = $('.shopping_history .history_list')
const deleteBtn = $('.list_delete')
const deleteAll = $('.deleteAll')

historyBtn.click(function () {
  historyPopup.stop().animate({
    right: 0
  }, 100);
}); //historyBtn_click_event

hideBtn.click(function () {
  historyPopup.stop().animate({
    right: -480
  }, 100);
}); //historyBtn_click_event

historyList.mouseover(function () {
  deleteBtn.css('display', 'block');
}); //historyBtn_click_event

historyList.mouseout(function () {
  deleteBtn.css('display', 'none');
}); //historyBtn_click_event

deleteBtn.mouseover(function () {
  deleteBtn.css('color', '#191919');
}); //historyBtn_click_event

deleteBtn.mouseout(function () {
  deleteBtn.css('color', '#ccc');
}); //historyBtn_click_event

deleteBtn.click(function () {
  historyList.css('display', 'none');
}); //historyBtn_click_event

deleteAll.click(function () {
  historyList.css('display', 'none');
}); //historyBtn_click_event
